			"additional-detail": "Speak 1 word command to target. Can't cause harm. Doesn't affect undead.",
			"per-higher-spell-level": "One more creature.",
			"bard": false,
			"cleric": true,
			"druid": false,
			"paladin": true,
			"ranger": false,
			"sorceror": false,
			"warlock": false,
			"wizard": false,
			"original-description": "You speak a one-word command to a creature you can see within range. The target must succeed on a Wisdom saving throw or follow the command on its next turn. The spell has no effect if the target is undead, if it doesnt understand your language, or if your command is directly harmful to it. \nSome typical commands and their effects follow. You might issue a command other than one described here. If you do so, the DM determines how the target behaves. If the target cant follow your command, the spell ends. \n\n**Approach.** The target moves toward you by the shortest and most direct route, ending its turn if it moves within 5 feet of you. \n\n**Drop.** The target drops whatever it is holding and then\nends its turn. \n\n**Flee.** The target spends its turn moving away from you by the fastest available means. \n\n**Grovel.** The target falls prone and then ends its turn. \n\n**Halt.** The target doesnt move and takes no actions. A flying creature stays aloft, provided that it is able to do so. If it must move to stay aloft, it flies the minimum distance needed to remain in the air.\n\n**At Higher Levels.** When you cast this spell using a spell slot of 2nd level or higher, you can affect one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them."
