			"v": true,
			"s": true,
			"m": true,
			"components": "incense, DIAMOND POWDER",
			"cost": "200 gp",
			"concentration": false,
			"duration": {
				"type": "until_dispelled_or_triggered"
			},
			"attack-saving-throw-effect": "",
			"damage-type": "",
